  \"Efficient Space Hardy Thermoelectric Materials with Broad Temperature Range Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:43:03.976701\",\n\t\"name\": \"efficient-space-hardy-thermoelectric-materials-with-broad-temperature-range-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The goal of this work is developing new
  thermoelectric materials for use in fabricating solid state cooling devices and
  electrical power generators, which are 200 to 300&#37; more efficient than current
  thermoelectric materials and can operate in temperatures ranging from cryogenic
  to 700 C.  These materials will be made from new nano-composites, using fabrication
  techniques developed at Eltron. rnrnThe proposed thermoelectric composite's matrix
  has already demonstrated exceptional ability for functioning in the environment
  of space.  Used in a cooling system, these materials will provide an effective means
  for controlling the temperature of surfaces subject to the rapidly changing temperatures
  encountered in space.  They can be used to prevent development of large temperature
  gradients and thereby prevent the mechanical stresses that accompany them.  Used
  for power-generation, these new materials will be very efficient both because of
  the properties that the nano-phase materials and its matrix bring to the thermoelectric
  material.  Because of the difficulties presented in the harsh environment of space,
  thermal management and power generation is most easily provided through devices
  that do not have any moving parts, are very durable, do not require maintenance,
  and operate efficiently over a wide range of temperatures.  The proposed materials
  meet all these requirements.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
